window.bookSummaryJSON = "<p><b>Join Tribe Moonguard as they continue to improve, adjust, and grow on their epic journey. </b> </p> <p>Damien is no longer the lost and confused Earthling. His magical progression provide powers greater than he ever envisioned, and he now commands an expanding army. </p> <p>To the south, a ratkin swarm prepares as Damien and Tribe Moonguard invade in the hopes of finding a permanent home. Fortune favors the bold, or so Damien believes as he leads his forces into battle.</p>"; 
